import React from 'react';

import "./Topbar.css";

function Topbar() {
    return (
        <div className="Topbar">
            <header class="header">
                <div class="app__container">

                    <div class="header__logo">
                        <img src="../../assets/fashionista_logo_topbar.png" alt="fashionista_logo_topbar" />
                    </div>
                    <div class="header__icons">
                        <button class="header__icons--search_icon">
                            <i class="fa fa-search" aria-hidden="true"></i>
                        </button>
                        <button class="header__icons--cart_icon">
                            <i class="fa fa-shopping-cart" aria-hidden="true"></i>
                        </button>
                    </div>
                </div>
            </header>
        </div>
    );
}

export default Topbar;
